/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `id` mediumint(8) NOT NULL auto_increment,
  `ordersn` varchar(20) NOT NULL COMMENT '订单编码',
  `cid` mediumint(8) default NULL COMMENT '是否指定冷库老板为执行者',
  `price` double(15,2) default '0.00',
  `cdate` int(10) NOT NULL COMMENT '订单生成日期',
  `pdate` int(10) NOT NULL COMMENT '预计完成日期',
  `uid` mediumint(8) NOT NULL COMMENT '订单生成者',
  `pstat` tinyint(1) NOT NULL default '0' COMMENT '订单是否采用竟价方式，0为指派，1为竟价，当为竟价时会在前端的交易平台显示',
  `ostat` tinyint(1) NOT NULL default '1' COMMENT '订单状态1为正常，0为关闭，2为完成',
  `cstat` tinyint(1) NOT NULL default '0' COMMENT '受指派冷库老板是否接受该订单0为未接受，1为接受',
  `hstat` tinyint(1) NOT NULL default '0' COMMENT '货款状态，0为未给商户钱，1为打款了',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `order` */

/*Table structure for table `order_info` */

DROP TABLE IF EXISTS `order_info`;

CREATE TABLE `order_info` (
  `id` mediumint(8) NOT NULL auto_increment,
  `orderid` mediumint(8) NOT NULL COMMENT '关联ID',
  `goodsid` int(8) NOT NULL COMMENT '产品ID',
  `price` double(15,2) default '0.00',
  `unit` varchar(20) NOT NULL default 'KG' COMMENT '计量单位',
  `counts` float NOT NULL default '0' COMMENT '重量/数量',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `order_info` */

/*Table structure for table `outbound` */

DROP TABLE IF EXISTS `outbound`;

CREATE TABLE `outbound` (
  `id` mediumint(8) NOT NULL auto_increment,
  `order-sn` varchar(20) NOT NULL COMMENT '采购单号',
  `out-sn` varchar(20) NOT NULL COMMENT '出库单号',
  `cid` int(8) NOT NULL COMMENT '出库负责人',
  `cdate` int(10) NOT NULL COMMENT '出库日期',
  `estimated` int(10) NOT NULL COMMENT '预计到达目的地日期',
  `tel` int(18) NOT NULL COMMENT '联系电话',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `outbound` */

/*Table structure for table `outbound_info` */

DROP TABLE IF EXISTS `outbound_info`;

CREATE TABLE `outbound_info` (
  `id` mediumint(8) NOT NULL auto_increment,
  `bound_id` int(8) NOT NULL COMMENT '出库主表ID',
  `goods-sn` varchar(20) NOT NULL COMMENT '商品条码',
  `gid` int(8) NOT NULL COMMENT '产品ID',
  `unit` varchar(20) NOT NULL default 'KG' COMMENT '计量单位',
  `counts` double(15,2) default '0.00',
  `price` double(15,2) default '0.00',
  `cid` int(8) NOT NULL COMMENT '当前冷库负责人',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `outbound_info` */

/*Table structure for table `party` */

DROP TABLE IF EXISTS `party`;

CREATE TABLE `party` (
  `id` mediumint(8) NOT NULL auto_increment,
  `compayname` varchar(40) NOT NULL COMMENT '客户公司名称',
  `tel` varchar(20) NOT NULL COMMENT '联系电话',
  `license` varchar(30) default NULL COMMENT '营业执照',
  `cname` varchar(40) default NULL COMMENT '联系人',
  `cdate` int(10) NOT NULL COMMENT '创建时间',
  `stat` tinyint(1) NOT NULL default '1' COMMENT '状态',
  `adder` varchar(200) default NULL COMMENT '公司地址',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `party` */

/*Table structure for table `payplan` */

DROP TABLE IF EXISTS `payplan`;

CREATE TABLE `payplan` (
  `id` int(8) NOT NULL auto_increment,
  `cid` mediumint(8) NOT NULL COMMENT '选择的缴费用户',
  `uid` tinyint(4) default '0' COMMENT '订单处理人，如果前端缴费，cid为0，结算中心缴费就为当前操作员id',
  `typeid` int(8) NOT NULL COMMENT '缴费类别',
  `amount` double NOT NULL default '0' COMMENT '缴费金额',
  `txt` text COMMENT '缴费备注',
  `paytype` tinyint(1) default '1' COMMENT '缴费渠道，1为终端机，0为结算中心',
  `ismessage` tinyint(1) default '0' COMMENT '是否短息通知，0为不知通，1为发送短息',
  `cdate` int(10) NOT NULL COMMENT '生成日期',
  `edate` int(10) NOT NULL COMMENT '到期日期',
  `paydate` int(10) default NULL COMMENT '缴费日期',
  `payact` tinyint(1) default '1' COMMENT '缴费方式，1：现金，2：金荣卡转账，3银行卡转账',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

